import React from 'react'
import './register.css'

export default function register() {
  return (
    <div className='registerPage'>
        <h1>Crack Your Goal with India's top educator</h1>
        <input className='inputBox' type='text' placeholder='Enter your Email'/><br></br>
        <input className='inputBox' type='text' placeholder='Enter your Password'/><br></br>
        <input className='inputBox' type='text' placeholder='Re-enter your password'/><br></br>
    </div>
  )
}
